import { Row, Col, Card, Avatar, Tabs, Form, Icon, Input, Button, Checkbox, Typography} from "antd";
const { TabPane } = Tabs;
class AddUser extends Component {

   constructor(props) {
    super(props);
    this.state = {
     userName:'',
     userId:'',
     errorMsg:'',
     Account_type:''
    }
 }
    render () {
        const formItemLayout = {
            labelCol: {
            xs: { span: 24 },
            sm: { span: 8 },
            },
            wrapperCol: {
            xs: { span: 24 },
            sm: { span: 16 },
            },
        };
        const tailFormItemLayout = {
            wrapperCol: {
